// src/App.jsx
import React from 'react';
import { Routes, Route } from 'react-router-dom';

import Home from './pages/Home';
import PetList from './pages/PetList';
import NovoPet from './pages/NovoPet';
import PetDetails from './pages/PetDetails';
import NovoEvento from './pages/NovoEvento';
import NovoAdmin from './pages/NovoAdmin';
import AdminList from './pages/AdminList';
import AdminDetails from './pages/AdminDetails';
import DonoDetails from './pages/DonoDetails';
import NovoDono from './pages/NovoDono';
import DonoList from './pages/DonoList';
import TutorList from './pages/TutorList';
import TutorDetails from './pages/TutorDetails';
import NovoTutor from './pages/NovoTutor';
import Login from './pages/Login';

import PrivateRoute from './components/PrivateRoute';
import Header from './components/Header';

export default function App() {
  return (
    <>
      <Header />
      <Routes>
        {/* Rota p√∫blica */}
        <Route path="/login" element={<Login />} />

        {/* Rotas protegidas */}
        <Route
          path="/"
          element={
            <PrivateRoute>
              <Home />
            </PrivateRoute>
          }
        />
        <Route
          path="/pets"
          element={
            <PrivateRoute>
              <PetList />
            </PrivateRoute>
          }
        />
        <Route
          path="/pets/novo"
          element={
            <PrivateRoute>
              <NovoPet />
            </PrivateRoute>
          }
        />
        <Route
          path="/pets/:id"
          element={
            <PrivateRoute>
              <PetDetails />
            </PrivateRoute>
          }
        />
        <Route
          path="/pets/:id/novo-evento"
          element={
            <PrivateRoute>
              <NovoEvento />
            </PrivateRoute>
          }
        />

        <Route
          path="/admins"
          element={
            <PrivateRoute>
              <AdminList />
            </PrivateRoute>
          }
        />
        <Route
          path="/admins/novo"
          element={
            <PrivateRoute>
              <NovoAdmin />
            </PrivateRoute>
          }
        />
        <Route
          path="/admins/:id"
          element={
            <PrivateRoute>
              <AdminDetails />
            </PrivateRoute>
          }
        />

        <Route
          path="/donos"
          element={
            <PrivateRoute>
              <DonoList />
            </PrivateRoute>
          }
        />
        <Route
          path="/donos/novo"
          element={
            <PrivateRoute>
              <NovoDono />
            </PrivateRoute>
          }
        />
        <Route
          path="/donos/:id"
          element={
            <PrivateRoute>
              <DonoDetails />
            </PrivateRoute>
          }
        />

        <Route
          path="/tutores"
          element={
            <PrivateRoute>
              <TutorList />
            </PrivateRoute>
          }
        />
        <Route
          path="/tutores/novo"
          element={
            <PrivateRoute>
              <NovoTutor />
            </PrivateRoute>
          }
        />
        <Route
          path="/tutores/:id"
          element={
            <PrivateRoute>
              <TutorDetails />
            </PrivateRoute>
          }
        />
      </Routes>
    </>
  );
}
